import React, { useEffect, useState } from 'react';
import './Home.css'; // Import your CSS file for styling

const Home = () => {
  const [text, setText] = useState('');
  const introText = "<p>Hello, I am Sandra Gonzalez, a Full Stack Software Engineer.</p>";

  useEffect(() => {
    let charIndex = 0;
    const typingInterval = setInterval(() => {
      if (charIndex < introText.length) {
        setText((prevText) => prevText + introText.charAt(charIndex));
        charIndex++;
      } else {
        clearInterval(typingInterval);
      }
    }, 100); // Adjust the typing speed (milliseconds per character)
  }, []);

  return (
    <div className="home">
      <div className="laptop">
        <div className="screen">
          <h1>{text}</h1>
        </div>
        <div className="keyboard">
          {/* Add keyboard elements here */}
          <div className="key-row">
            <div className="key">Q</div>
            <div className="key">W</div>
            <div className="key">E</div>
            <div className="key">R</div>
            <div className="key">T</div>
            {/* Add more keys here */}
          </div>
          <div className="key-row">
            <div className="key">A</div>
            <div className="key">S</div>
            <div className="key">D</div>
            <div className="key">F</div>
            <div className="key">G</div>
            {/* Add more keys here */}
          </div>
          {/* Add more key rows here */}
        </div>
      </div>
      <div className="cover-letter">
        {/* Add your cover letter content here */}
        <div className="cover-letter-heading">
          <span className="cursive-hello">Hello,</span>
        </div>
        <div className="cover-letter-text">
          <p>
            I am Sandra Gonzalez, a Full Stack Software Engineer with a passion for creating innovative solutions and bringing ideas to life. I'm ready to take on new challenges and contribute to exciting projects.
          </p>
        </div>
      </div>
      <div className="divider"></div>
      <div className="video-section">
       <h1>My a</h1>
        {/* Add your video or multimedia content here */}
        <iframe
          width="100%" /* Make the video take up 100% width of its container */
          height="315"
          src="https://www.youtube.com/embed/your_video_id_here"
          title="Your Video Title"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
    </div>
  );
};

export default Home;
